INSERT INTO `events` (`eid`, `galleryn`, `date`, `about`, `host`, `place`, `images`, `state`) VALUES
(1, 'Abundance of Art', '2017-01-21', 'Artists are truly magicians as they excel in converting the simplest things to WOW master pieces. The 14th edition of Chitra Santhe organized by Karnataka Chitrakala Parishath at Kumara Krupa Road, Bengaluru was transformed into an art gallery with colourful and mesmerizing art work of numerous artists coming from different parts of the country. 15th January 2017, Sunday was a super energetic day where people of all age groups were gathered to appreciate the abundant artistic talent that India possess. The event was inaugurated by Karnataka Chief Minister Shri. Siddaramaiah.\r\n\r\n\r\nAbstract and modern art paintings flaunted amazing creativity and imagination of the artists. Reproduction of landscapes, wildlife, flowers, mythological characters and human figures were beautifully done. The large portraits of women, children, Buddha and Mona Lisa were almost appearing to be alive. Some of the paintings were hyperrealism that attracted the attention of the onlooker such that it was tough to move away! \r\n\r\n\r\nThe painting medium primarily used was acrylic colours, oil paints and water colours while charcoal and pastel sticks were used distinctively by a few artists. The amalgamation of colours on canvas, oil paper and cardboard sheets was ingeniously executed. The strokes of brushes on the paintings had spectators wanting to create their own art pieces.The life of the exhibition was the live art performances by the students. Students Diana, Mohit and Arun Kumar showcased their creativity on themselves by smearing paint on their body and altering themselves into sculptures; to spread the message of love and harmony. Live classical and rock band music feats also entertained the visitors. Some artists offered services such as small portraits/sketches, temporary tattoos, caricature and nail art.Exclusive iconic art form styles of our nation namely Thanjavur, Madhubhani, and Worli were presented. Though practiced by only limited artists the art is kept intact. The new styles of painting developed by three artists were impressive. \r\nIt was great learning experience for the students from bachelor, master and PhD programs in art discipline of the institute. 165 student volunteers were on the constant move for any help needed by the visitors or participants.\r\nIt was well planned event arranged with the good team work of the management, faculty and students of Chitrakala Parishath. They received commendable support and assistance of police and traffic police personnel. All the participants were given the certificates. There was something for all tastes and budgets of the visitors. A must visit show for sure!', 'Shweta Dhanuka', 'Kumara Krupa Road, Bengaluru ', , 'Karnataka');
INSERT INTO `events` (`eid`, `galleryn`, `date`, `about`, `host`, `place`, `images`, `state`) VALUES
(2, ' 50 Shades of Black and White ', '2016-10-24', 'VAG is a space that artists pride to showcase their talents. 50 Shades of Black and White was an art exhibition held for a week over two batches to display artwork. Artists from all around the Garden City had set out their paintings in this ambient gallery. Covering scopes of nature, portraits, abstract and landscapes, artists have used different styles and mediums such as acrylic, oil, charcoal, water colours, paper-cutting, lino print, pencil and ink on canvas and hand-made paper. Ravindran, a techie at Infosys is an art-enthusiast. This is my first time at this gallery and I am awed by the history and cultures of South-India, says Ravindran. The paintings here were exquisite and I was also fascinated by the remains from Tippus era in the museum, added Ravindran.The museum also holds artefacts from the 17th and 18th Century. Paint relics from places such as Basholi, Tanjor, Bundhelkhand, Deccan and Mysore are on display throughout the year. Most of them have inscriptions in either Sanskrit or Arabic. The museum also has a wide-range display of weaponry, clay ornaments, musical instruments, wood carvings, cloth paintings, and megalith and microlith figures from the Circa Time Period. It also has a space dedicated to selling insightful books on archaeology.Meghana, a home-maker visited the gallery with her family. The minute attention to details in some of the exhibited paintings was of great influence says Meghana. The notion Positivity leads to peace has taught me a lot, added Meghana. ', 'Dhruva Mignon', 'Venkatappa Art Gallery , central bangalore', , 'Karnataka');
INSERT INTO `events` (`eid`, `galleryn`, `date`, `about`, `host`, `place`, `images`, `state`) VALUES
(4, 'Dilkash Group Art Exhibition', '2017-12-11', '*Call for Artists* *Dilkash* *Group Art Exhibition* *09th Dec till 11th Dec 2017* *Artizen Art Gallery* New Delhi More information call us at 91-9953407433 Critically acclaimed curator Erum Khan, following up on the huge success of such exhibitions as Khushrang, Rhimjhim, Kabir, Sarhadein, Salaam India, Akbar and Taj, is all set to organize her new exhibition Dilkash. Artists are invited to participate in this exhibition, which would be a celebration of beauty, with their enchanting works of art that would be given a platform to earn recognition and appreciation from art lovers and prospective buyers. \"No restriction of theme or subject\"', 'Dilkash Group ', 'Artizen Art Gallery , Delhi', , 'Delhi');

